PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE users (
	id INTEGER NOT NULL, 
	username VARCHAR(80) NOT NULL, 
	password VARCHAR(120) NOT NULL, 
	created_at DATETIME, 
	last_login DATETIME, 
	is_active BOOLEAN, 
	PRIMARY KEY (id), 
	UNIQUE (username)
);
INSERT INTO users VALUES(1,'admin','scrypt:32768:8:1$zvgavp0Bm0pLtJDQ$95ae84f76f12e00c9a5907d94bc2a3213b775bbf36ca7763acf6e364f46b129aa0ba813ae38da01821be5cd8f59216290dfce0d619140c33277ab52b072dcf9d','2025-04-09 19:46:43.081757','2025-04-16 07:39:11.769540',1);
CREATE TABLE events (
	id INTEGER NOT NULL, 
	title VARCHAR(200) NOT NULL, 
	content TEXT NOT NULL, 
	date DATE NOT NULL, 
	location VARCHAR(200), 
	created_at DATETIME, 
	updated_at DATETIME, 
	tags VARCHAR(200), 
	is_important BOOLEAN, 
	images TEXT, 
	created_by INTEGER, 
	updated_by INTEGER, 
	PRIMARY KEY (id), 
	FOREIGN KEY(created_by) REFERENCES users (id), 
	FOREIGN KEY(updated_by) REFERENCES users (id)
);
